283	la-ferme-en-direct	La Ferme en Direct	2019-03-24 15:26:35.517539+01	2019-03-24 15:26:35.523537+01	t	Une poignée d’agriculteurs locaux a décidé de revenir aux sources. «Comme mes grands-parents qui vendaient leurs produits au marché, on se réapproprie l’acte de vente», compare Thierry Peyrègne, producteur de bovins à Jarret. Ainsi, 28 agriculteurs de Lourdes et du département se sont rassemblés autour de la société Ferme en direct, dont Guy Sayous, producteur laitier à Lourdes, est le président. Ils étaient déjà une majorité à faire de la vente directe sur leur exploitation. «Il y avait une demande, mais nous n’avions pas de main-d’œuvre», commente Yves Cassagnet, producteur de porcs à Ibos. Avec cette boutique située au 6, rue François-Abadie, il n’y a désormais plus d’intermédiaires, puisque les producteurs font directement fonctionner le magasin. Pour autant, cette ouverture a permis de créer cinq emplois, dont trois en boutique et deux sur la coopérative agricole des Gaves qui transforme la viande.\nCoordonné par Chantal Merigot, de la chambre d’agriculture 65, ce projet a démarré en février 2012. Un groupe soudé est né. «On a les mêmes valeurs : le produit frais, le respect de l’environnement et on pratique une agriculture raisonnée», défend Guy SAYOUS. Avec ses légumes de saison, son espace boucherie, ses fromages et autres douceurs, la Ferme en direct amène des produits de qualité à un prix raisonnable dans un espace aux allures de grange avec ses poutres apparentes.\nHoraires d’ouverture:\ndu lundi au jeudi de 8h30 à 12h30 et de 14h30 à 19h00.\nle vendredi et le samedi\nde 8h30 à 19h00 sans interruption.	- Notre DRIVE FERMIER sur notre site www.laferme-endirect.fr	6 Avenue François Abadie	65100	Lourdes	FR	0101000020E6100000A56B26DF6C73A3BF2EFF21FDF68D4540	http://www.laferme-endirect.fr/	shop_images/283_gV2dYR7.png	+33562934773	la-ferme-en-direct@orange.fr	0	\N	66
