1	alsace	Alsace	2019-03-24 15:26:29.997708+01	2019-03-24 15:26:29.997734+01	0101000020E6100000C009850838C41D4029CB10C7BA284840	La plus petite des régions de France où les agriculteurs cultivent principalement la vigne et les grandes cultures comme les céréales. L’alsace dispose également de productions plus spécialisées qui participent à la réputation de sa gastronomie comme le houblon qui aromatise ses bières, le chou sans qui il n’y aurait pas de choucroute, ou encore les quetsches qui après fermentation et distillation produisent l’eau-de-vie. L’Alsace possède 842 produits sous appellation AOC/AOP. 840 sont des vins avec essentiellement des vins blancs secs ou secs tendres parfois élaborés en crémant sans oublier l’eau-de-vie Marc d’Alsace Gewurztraminer et le fromage Munster. Un quart des exploitations alsaciennes vendent en circuits courts.	16
