3	auvergne	Auvergne	2019-03-24 15:26:30.024343+01	2019-03-24 15:26:30.024379+01	0101000020E61000006E3480B740C20A406EA301BC05DA4640	La première prairie de France est occupée majoritairement par des troupeaux de Charolaise, Montbéliarde mais aussi Limousine ou Aubrac. Des éleveurs laitiers qui se sont engagés dans une démarche de qualité avec 8 fromages bénéficiant d’une AOC/AOP comme le Saint-Nectaire, le Cantal, le Salers, le Bleu d’Auvergne, la Fourme d’Ambert ou le Laguiol. La région possède une autre célèbre AOC/AOP, La Lentille verte du Puy.	6
